import React from "react";
import styled from "styled-components";

function About() {
  const Wrapper = styled.div`
    min-height: 70vh;
    background-color: rgb(190, 188, 189);
  `;
  return (
    <Wrapper>
      <div></div>
    </Wrapper>
  );
}

export default About;
